let flowerInBascet = {
    arrayFlowers: []
}


export const reducer = (state, action) => {
    console.log(typeof(state))
    if (action.type == 'setFlower') {
        return state = action.payload;
    }
    if (action.type == 'getFlower') {
        return state;
    }
    
}
